import React from "react";
import classes from "./Myproject.module.css";
import projects1 from "../../../assets/projects1.png";

const Myprojects = () => {
  return (
    <React.Fragment>
      <div className={classes.projects}>
        <div className={classes.row}>
          <div className={classes.column}>
            <img src={projects1} />
          </div>
            <h1>Projects</h1>
            <p>
              My projects makes use of vast variety of latest technology tools.
              My best experience is to create the dynamic Web Apps(SPA) including
              Frontend &#38; Backend and also the Deep Learning projects that
              solves real world problem and deploy them to web applications
              using cloud infrastructure.
            </p>
        </div>
      </div>
    </React.Fragment>
  );
};

export default Myprojects;
